import React from 'react';

const ProfitabilityTable = ({ data }) => {
  if (!data || data.length === 0) {
    return <p>No data available</p>;
  }

  return (
    <div className="profitability-table">
      <table>
        <thead>
          <tr>
            <th>Prize Group</th>
            <th>Share Count</th>
            <th>Share Prize</th>
          </tr>
        </thead>
        <tbody>
          {data.map((entry, index) => (
            <tr key={index}>
              <td colSpan="3" className="total-shares">
                Total Share Count: {entry.totalShareCount}
              </td>
            </tr>
          ))}
          {[1, 2, 3, 4, 5, 6, 7].map((group) => (
            <tr key={group}>
              <td>Prize Group {group}</td>
              <td>
                {data[0].shareCounts[`shareCount${group}`] !== undefined 
                  ? data[0].shareCounts[`shareCount${group}`] 
                  : 'N/A'}
              </td>
              <td>
                {data[0].sharePrizes[`sharePrize${group}`] !== undefined 
                  ? `$${data[0].sharePrizes[`sharePrize${group}`].toLocaleString()}` 
                  : 'N/A'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProfitabilityTable;
